import React from 'react';
import {Container, Navbar} from "react-bootstrap";
import {GrElevator} from "react-icons/gr"

const Home = () => {
    return (
        <div>
            <Navbar bg="light">
                <Container>
                    <GrElevator/>
                </Container>
                <Container>
                    <Navbar.Brand>Brand text</Navbar.Brand>
                </Container>
            </Navbar>
        </div>
    );
};

export default Home;
